    }

    void setFontSize(int size) {
        fontSize = size;
    }

    void setFontName(const char* name) {
        strncpy(fontName, name, sizeof(fontName) - 1);
        fontName[sizeof(fontName) - 1] = '\0'; // Ensure null-termination
