    std::vector<Unicode> unicodeArray(unicodeCount); // Create a Unicode array
    for (int i = 0; i < unicodeCount; ++i) {
        unicodeArray[i] = stream.ConsumeIntegral<Unicode>(); // Fill the Unicode array with random values
    }
    GBool flag1 = stream.ConsumeBool(); // First boolean parameter
    GBool flag2 = stream.ConsumeBool(); // Second boolean parameter
    GBool flag3 = stream.ConsumeBool(); // Third boolean parameter

    // Call the function under test
	auto start_func = std::chrono::high_resolution_clock::now();//erase
    splashOutputDev.drawChar(&gfxState, x, y, width, height, xOffset, yOffset, charCode, fontSize, unicodeArray.data(), unicodeCount, flag1, flag2, flag3);
	auto end_func = std::chrono::high_resolution_clock::now();//erase
auto end_target = std::chrono::high_resolution_clock::now();//erase
std::cout<<"Target runtime : "<<std::chrono::duration_cast<std::chrono::nanoseconds>(end_target-start_target).count()<<", Function runtime : "<<std::chrono::duration_cast<std::chrono::nanoseconds>(end_func - start_func).count()<<std::endl;//erase

